import React from "react";

function TableRow(props) {
  const {
    srNo,
    accountNo,
    name,
    email,
    balance,
    contactNo,
    accountType,
  } = props;

  return (
    <>
      <tr>
        <th scope="row">{srNo}</th>
        <td>{accountNo}</td>
        <td>{name}</td>
        <td>{email}</td>
        <td>$ {balance}</td>
        <td>{contactNo}</td>
        <td>{accountType}</td>
        <td>
          <div className="btn btn-outline-success">Update</div>
          <div className="btn btn-outline-danger">Delete</div>
        </td>
      </tr>
    </>
  );
}

export default TableRow;
